import React, { Component } from 'react';
import ReactTypingEffect from 'react-typing-effect';
import profilepic from '../img/profilepic.png';

import { Link } from "react-router-dom";

class Home extends Component {
    render() {
        return (
            <div className="frontpage">
                <img src={profilepic} className="profilepic"></img>
                <ReactTypingEffect className="typingeffect" text={['Hi, my name is Ása']} speed={70} eraseDelay={700}/>

                <div class="social">

                <a href="https://codepen.io/asajulia" target="_blank"><i class="fab fa-codepen"></i></a>
                <a href="https://github.com/asajulia" target="_blank"><i class="fab fa-github"></i></a>
                <a href="https://www.instagram.com/asajulia/" target="_blank"><i class="fab fa-instagram"></i></a>
                <a href="https://www.facebook.com/asajuliaa/" target="_blank"><i class="fab fa-facebook-f"></i></a>
                <a href="https://www.linkedin.com/in/asajulia/" target="_blank"><i class="fab fa-linkedin-in"></i></a>
            </div>
            </div>
        )
    }
}
export default Home
